import React from 'react';
import {Link} from 'react-router-dom';

const myStore = (props) => {
  return (
    <div>
      <a href={props.url} target="_blank"></a>
  <label>{props.name} </label>&nbsp;&nbsp;
  <a href={props.url} target="_blank">To the website</a>
    </div>
  )
}
export default myStore;
